    source: "\n.vue-tel-input {\n  border-radius: 3px;\n  display: flex;\n  border: 1px solid #bbb;\n  text-align: left;\n}\n.vue-tel-input.disabled .selection,\n.vue-tel-input.disabled .dropdown,\n.vue-tel-input.disabled input {\n  cursor: no-drop;\n}\n.vue-tel-input:focus-within {\n  box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075), 0 0 8px rgba(102, 175, 233, 0.6);\n  border-color: #66afe9;\n}\n.vti__dropdown {\n  display: flex;\n  flex-direction: column;\n  align-content: center;\n  justify-content: center;\n  position: relative;\n  padding: 7px;\n  cursor: pointer;\n}\n.vti__dropdown.show {\n  max-height: 300px;\n  overflow: scroll;\n}\n.vti__dropdown.open {\n  background-color: #f3f3f3;\n}\n.vti__dropdown:hover {\n  background-color: #f3f3f3;\n}\n.vti__selection {\n  font-size: 0.8em;\n  display: flex;\n  align-items: center;\n}\n.vti__selection .vti__country-code {\n  color: #666;\n}\n.vti__flag {\n  margin-right: 5px;\n  margin-left: 5px;\n}\n.vti__dropdown-list {\n  z-index: 1;\n  padding: 0;\n  margin: 0;\n  text-align: left;\n  list-style: none;\n  max-height: 200px;\n  overflow-y: scroll;\n  position: absolute;\n  left: -1px;\n  background-color: #fff;\n  border: 1px solid #ccc;\n  width: 390px;\n}\n.vti__dropdown-list.below {\n  top: 33px;\n}\n.vti__dropdown-list.above {\n  top: auto;\n  bottom: 100%;\n}\n.vti__dropdown-arrow {\n  transform: scaleY(0.5);\n  display: inline-block;\n  color: #666;\n}\n.vti__dropdown-item {\n  cursor: pointer;\n  padding: 4px 15px;\n}\n.vti__dropdown-item.highlighted {\n  background-color: #f3f3f3;\n}\n.vti__dropdown-item.last-preferred {\n  border-bottom: 1px solid #cacaca;\n}\n.vti__dropdown-item .vti__flag {\n  display: inline-block;\n  margin-right: 5px;\n}\n.vti__input {\n  border: none;\n  border-radius: 0 2px 2px 0;\n  width: 100%;\n  outline: none;\n  padding-left: 7px;\n}\n",
